				'آرى! ماييم كه مردگان را زنده مى‌سازيم و آنچه را از پيش فرستاده‌اند، با آثار [و اعمال‌]شان درج مى‌كنيم، و هر چيزى را در كارنامه‌اى روشن برشمرده‌ايم.',
